In math, a variable is some value that keeps changing, thus we assign it a name like x or y. The idea of variables in programming is pretty much the same. In programming terms, you can store values in variables that tend to change. For example, if you built a game, you could store the player's name, score etc. in variables. Let's look at an example #include <stdio.h> int main(){ int a = 42; int b = 13; return 0;
} In this example, we declared 2 variables a and b and stored the values 42 and 13 in them respectively. If you noticed, we had to write int before a and b. int here is the data type of a and b, it stands for integer. In C, when we declare variables, we have to mention the type of data we intend to store in that variable, that's called the Data Type of that variable. There are 4 basic data types in C : int : The Integer type, used to store positive and negative integers float : The Float type, used to store values with decimal places double : The Double type, very similar to float, used to store decimal values, the difference is that double has an extended range, it can store twice as many significant digits as compared to a float. char : The Character type, used to store characters, symbols and special characters. They are formed by enclosing the character in two single quotes ('A', ';', '?','@') Example #include <stdio.h> int main(){ int age = 10; float weight = 72.46; double pi = 3.1415926535897; char classroom = 'A'; char question = '?'; return 0;
}

