It is used to print data on the screen, we used this function previously to print "Hello, World!", another feature of printf is that we can also use it to print variables #include <stdio.h> int main(){ int a = 42; printf("The answer to life, universe and everything is %i\n", a); return 0;
} This will give the following output $ ./a.out
The answer to life, universe and everything is 42 printf() replaces the %i with the variable passed next to it, i here implies that the variable passed is an integer, these are called format specifiers . We can also use %d in place of %i, both work for printing integers. A list of all the basic format specifiers is given below %i or %d : for integers %c : for characters %f : for floats and doubles %e : for floats in scientific format, that is 12.67 will be printed as 1.267000e+01 Example #include <stdio.h> int main(){ int age = 50; float weight = 72.46; double pi = 3.1415926535897; char classroom = 'A'; char question = '?'; printf("C is almost %d years old\n", age); printf("The satellite weighs %f tons\n", weight); printf("The satellite weighs %e tons\n", weight); printf("My favourite constant is %f\n", pi); printf("Where is class %c %c\n", classroom, question); // you can also pass multiple variables printf("%i %f %f\n", age, weight, pi) return 0;
} The output will be $ ./a.out
C is almost 50 years old
The satellite weighs 72.459999 tons
The satellite weighs 7.246000e+01 tons
My favourite constant is 3.141593
Where is class A ?
50 72.459999 3.141593
